import smtplib
from email.mime.text import MIMEText
from email.mime.multipart import MIMEMultipart

# Encodeamos la imagen en base64 para poder enviarla embebida
# en el codigo html del email
img = r"data:image/png;base64,"
body = '''
<h3>Practica 12</h3>
<p>Ejercicio de la practica 12 para envío de correos</p>
<p><strong>Nombre:</strong> Juan Angel Garza Castillo</p>
<p><strong>Matricula:</strong> 2007612</p>
<p><img src="{}"/></p>
'''.format(img)

# Creamos la conexión al servidor SMTP de Gmail
connection = smtplib.SMTP('smtp.gmail.com', 587)
connection.starttls()
connection.login('XXXXXXXX@gmail.com', 'XXXXXXXXXXXXXXXXXXXX')

# Creamos un mensaje multiparte con MIME para agregar nuestro codigo html
msg = MIMEMultipart('alt')
msg['Subject'] = 'Prueba de envio (script Python) - 2007612'
msg['To'] = 'gerardo.bernal@uanl.edu.mx'
msg['From'] = 'XXXXXXXX@gmail.com'
html = MIMEText(body, 'html')
msg.attach(html)

# Enviamos el correo
connection.sendmail('XXXXXXXX@gmail.com', 'gerardo.bernal@uanl.edu.mx', msg.as_string())